    "    ('XGBoost', XGBClassifier(), {'learning_rate': [0.01, 0.1, 0.2], 'n_estimators': [50, 100, 200]}),\n",
    "    ('Logistic Regression', LogisticRegression(max_iter=1000), {'C': [0.1, 1, 10]})\n",
    "]\n",
    "\n",
    "# Set up subplots\n",
    "fig, axes = plt.subplots(nrows=2, ncols=3, figsize=(15, 10))\n",
    "axes = axes.flatten()\n",
    "\n",
    "# Evaluate and generate classification reports and confusion matrices with grid search\n",
    "for i, (model_name, model, param_grid) in enumerate(models):\n",
